                        {todoElement}
                        {index % 2 === 0 ? <span>‚òÄÔ∏è</span> : <span>üíß</span>}
                        <button
                            onClick={() => {
                                setCart(() => {
                                    cart.splice(index + 1, 1);
                                    console.log(`element ${index} deleted`);
